INSERT INTO `forum` VALUES (1,'2013-02-26 Module 1 Lab','<?php\n// public/index.php\n/**\n * This makes our life easier when dealing with paths. Everything is relative\n * to the application root now.\n */\nchdir(dirname(__DIR__));\n\n// Setup autoloading\n//require \'init_autoloader.php\';\n$zf2Path = \'vendor/ZF2/library\';\ninclude $zf2Path . \'/Zend/Loader/AutoloaderFactory.php\';\nZend\\Loader\\AutoloaderFactory::factory(array(\n	\'Zend\\Loader\\StandardAutoloader\' => array(\n		\'autoregister_zf\' => true\n	)\n));\nrequire $zf2Path . \'/Zend/Stdlib/compatibility/autoload.php\';\nrequire $zf2Path . \'/Zend/Session/compatibility/autoload.php\';\n\n// Run the application!\nZend\\Mvc\\Application::init(require \'config/application.config.php\')->run();\n','2013-02-27 07:25:00','zf2f-2013-02-25','doug@unlikelysoruce.org','zf2'),(2,'Mod 6 Lab -- PostController.php','<?php\r\n/**\r\n * Zend Framework (http://framework.zend.com/)\r\n *\r\n * @link      http://github.com/zendframework/Market for the canonical source repository\r\n * @copyright Copyright (c) 2005-2012 Zend Technologies USA Inc. (http://www.zend.com)\r\n * @license   http://framework.zend.com/license/new-bsd New BSD License\r\n */\r\n\r\nnamespace Market\\Controller;\r\n\r\nuse Zend\\View\\Model\\ViewModel;\r\nuse Zend\\Mvc\\Controller\\AbstractActionController;\r\n\r\nclass PostController extends AbstractActionController\r\n{\r\n	public $categories = array();\r\n    public function indexAction()\r\n    {\r\n    	$viewModel = new ViewModel(array(\'categories\' => $this->categories));\r\n    	$viewModel->setTemplate(\'market/post/index.phtml\'); \r\n        return $viewModel;\r\n    }\r\n\r\n}\r\n','2013-03-05 08:23:30','zf2f-2013-02-25','doug@unlikelysoruce.org','zf2'),(3,'Mod 6 Lab -- PostControllerFactory.php','<?php\r\nnamespace Market\\Factory;\r\n\r\nuse Market\\Controller\\PostController;\r\nuse Zend\\ServiceManager\\ServiceLocatorInterface;\r\nuse Zend\\ServiceManager\\FactoryInterface;\r\n\r\nclass PostControllerFactory implements FactoryInterface\r\n{\r\n	public function createService(ServiceLocatorInterface $controllerManager)\r\n	{\r\n		$serviceManager = $controllerManager->getServiceLocator()->get(\'ServiceManager\');\r\n		$controller = new PostController();\r\n		$controller->categories = $serviceManager->get(\'application-categories\');\r\n		return $controller;\r\n	}\r\n}','2013-03-05 08:23:30','zf2f-2013-02-25','doug@unlikelysoruce.org','zf2'),(4,'Mod 6 Lab -- module.config.php','<?php\r\nreturn array(\r\n    \'controllers\' => array(\r\n        \'invokables\' => array(\r\n            \'market-index-controller\' => \'Market\\Controller\\IndexController\',\r\n            \'market-view-controller\' => \'Market\\Controller\\ViewController\',\r\n        ),\r\n        \'factories\' => array(\r\n            \'market-post-controller\' => \'Market\\Factory\\PostControllerFactory\',\r\n        ),\r\n    	\'aliases\' => array(\r\n    		\'alt\' => \'market-view-controller\',\r\n    	),\r\n    ),\r\n    \'router\' => array(\r\n        \'routes\' => array(\r\n            \'market\' => array(\r\n                \'type\'    => \'Literal\',\r\n                \'options\' => array(\r\n                    // Change this to something specific to your module\r\n                    \'route\'    => \'/market\',\r\n                    \'defaults\' => array(\r\n                        // Change this value to reflect the namespace in which\r\n                        // the controllers for your module are found\r\n                        //\'__NAMESPACE__\' => \'Market\\Controller\',\r\n                        \'controller\'    => \'market-index-controller\',\r\n                        \'action\'        => \'index\',\r\n                    ),\r\n                ),\r\n                \'may_terminate\' => true,\r\n                \'child_routes\' => array(\r\n                    // This route is a sane default when developing a module;\r\n                    // as you solidify the routes for your module, however,\r\n                    // you may want to remove it and replace it with more\r\n                    // specific routes.\r\n                    \'default\' => array(\r\n                        \'type\'    => \'Segment\',\r\n                        \'options\' => array(\r\n                            \'route\'    => \'/[:controller[/:action]]\',\r\n                            \'constraints\' => array(\r\n                                \'controller\' => \'[a-zA-Z][a-zA-Z0-9_-]*\',\r\n                                \'action\'     => \'[a-zA-Z][a-zA-Z0-9_-]*\',\r\n                            ),\r\n                            \'defaults\' => array(\r\n                            ),\r\n                        ),\r\n                    ),\r\n                ),\r\n            ),\r\n        ),\r\n    ),\r\n    \'view_manager\' => array(\r\n        \'template_path_stack\' => array(\r\n            __DIR__ . \'/../view\',\r\n        ),\r\n    ),\r\n);\r\n','2013-03-05 08:25:02','zf2f-2013-02-25','doug@unlikelysoruce.org','zf2'),(5,'Routing Examples -- module.config.php','<?php\r\n// NOTE: using PHP 5.4 array syntax\r\nreturn [\r\n	\'controllers\' => [\r\n		\'invokables\' => [\r\n			\'route-test-controller-index\' => \'RouteTest\\Controller\\IndexController\',\r\n		],\r\n	],\r\n	\'router\' => [\r\n		\'routes\' => [\r\n			\'route-test-home\' => [\r\n				\'type\' => \'Zend\\Mvc\\Router\\Http\\Segment\',\r\n				\'options\' => [\r\n					\'route\'    => \'/route-test[/]\',\r\n					\'defaults\' => [\r\n						\'controller\' => \'route-test-controller-index\',\r\n						\'action\'     => \'index\',\r\n					],\r\n				],\r\n			],\r\n			\'route-test-method-post\' => [\r\n				\'type\' => \'Zend\\Mvc\\Router\\Http\\Method\',\r\n				\'options\' => [\r\n					\'verb\'    => \'post\',\r\n					\'defaults\' => [\r\n						\'controller\' => \'route-test-controller-index\',\r\n						\'action\'     => \'method-post\',\r\n					],\r\n				],\r\n			],\r\n			\'route-test-wildcard\' => [\r\n				\'type\' => \'Zend\\Mvc\\Router\\Http\\Literal\',\r\n				\'options\' => [\r\n					\'route\'    => \'/route-test-wildcard\',\r\n					\'defaults\' => [\r\n						\'controller\' => \'route-test-controller-index\',\r\n						\'action\'     => \'wildcard\',\r\n					],\r\n				],\r\n				\'may_terminate\' => true,\r\n				\'child_routes\'  => [\r\n					\'wildcard\' => [\r\n						\'type\' => \'Zend\\Mvc\\Router\\Http\\Wildcard\',\r\n					],\r\n				],\r\n			],\r\n			\'route-test-query\' => [\r\n				\'type\' => \'Zend\\Mvc\\Router\\Http\\Segment\',\r\n				\'options\' => [\r\n					\'route\'    => \'/route-test-query[/:a]\',\r\n					\'defaults\' => [\r\n						\'controller\' => \'route-test-controller-index\',\r\n						\'action\'     => \'query\',\r\n					],\r\n				],\r\n				\'may_terminate\' => true,\r\n				\'child_routes\'  => [\r\n					\'query\' => [\r\n						\'type\' => \'Query\',\r\n					],\r\n				],\r\n			],\r\n			\'route-test-hostname\' => [\r\n				\'type\' => \'Zend\\Mvc\\Router\\Http\\Hostname\',\r\n				\'options\' => [\r\n					\'route\'    => \'route-test.unlikelysource.local\',\r\n					\'defaults\' => [\r\n						\'controller\' => \'route-test-controller-index\',\r\n						\'action\'     => \'hostname\',\r\n					],\r\n				],\r\n			],\r\n		],\r\n	],\r\n    \'view_manager\' => [\r\n        \'template_path_stack\' => [\r\n            __DIR__ . \'/../view\',\r\n        ],\r\n    ],\r\n];','2013-03-06 10:44:16','zf2f-2013-02-25','doug@unlikelysoruce.org','zf2'),(6,'Routing Examples -- IndexController.php','<?php\r\nnamespace RouteTest\\Controller;\r\n\r\nuse Zend\\Mvc\\Controller\\AbstractActionController;\r\nuse Zend\\View\\Model\\ViewModel;\r\n\r\nclass IndexController extends AbstractActionController\r\n{\r\n	public function indexAction()\r\n	{\r\n		$viewModel = new ViewModel(array(\'name\' => \'INDEX\'));\r\n		$viewModel->setTemplate(\'route-test/index/index.phtml\');\r\n		return $viewModel;\r\n	}\r\n	public function hostnameAction()\r\n	{\r\n		$viewModel = new ViewModel(array(\'name\' => \'HOSTNAME\'));\r\n		$viewModel->setTemplate(\'route-test/index/index.phtml\');\r\n		return $viewModel;\r\n	}\r\n	public function queryAction()\r\n	{\r\n		$params = array_merge($this->params()->fromQuery(), $this->params()->fromRoute());\r\n		$viewModel = new ViewModel(array(\'name\' => \'QUERY\', \'params\' => $params));\r\n		$viewModel->setTemplate(\'route-test/index/show-params.phtml\');\r\n		return $viewModel;\r\n	}\r\n	public function wildcardAction()\r\n	{\r\n		$params = array_merge($this->params()->fromQuery(), $this->params()->fromRoute());\r\n		$viewModel = new ViewModel(array(\'name\' => \'WILDCARD\', \'params\' => $params));\r\n		$viewModel->setTemplate(\'route-test/index/show-params.phtml\');\r\n		return $viewModel;\r\n	}\r\n	public function methodGetAction()\r\n	{\r\n		$viewModel = new ViewModel(array(\'name\' => \'METHOD - GET\'));\r\n		$viewModel->setTemplate(\'route-test/index/index.phtml\');\r\n		return $viewModel;\r\n	}\r\n	public function methodPostAction()\r\n	{\r\n		$params = array_merge($this->params()->fromPost());\r\n		$viewModel = new ViewModel(array(\'name\' => \'METHOD - POST\', \'params\' => $params));\r\n		$viewModel->setTemplate(\'route-test/index/show-params.phtml\');\r\n		return $viewModel;\r\n	}\r\n}','2013-03-06 10:44:16','zf2f-2013-02-25','doug@unlikelysoruce.org','zf2'),(7,'Routing Examples -- index.phtml','<h1>Route Test -- <?php echo $this->name; ?></h1>\r\n<ul>\r\n<li><a href=\"<?php echo $this->url(\'route-test-hostname\'); ?>\">route-test-hostname</a></li>\r\n<li><a href=\"<?php echo $this->url(\'route-test-query\'); ?>\">route-test-query</a></li>\r\n<li><a href=\"<?php echo $this->url(\'route-test-query/query\', array(\'a\' => \'A\')); ?>\">route-test-query/query</a></li>\r\n<li><a href=\"<?php echo $this->url(\'route-test-query/query\', array(\'a\'=> \'A\', \'b\' => \'B\', \'c\' => \'C\')); ?>\">route-test-query/query, array(\'a\'=> \'A\', \'b\' => \'B\', \'c\' => \'C\')</a></li>\r\n<li><a href=\"<?php echo $this->url(\'route-test-wildcard/wildcard\', array(\'a\'=> \'A\', \'b\' => \'B\', \'c\' => \'C\')); ?>\">route-test-wildcard, array(\'a\'=> \'A\', \'b\' => \'B\', \'c\' => \'C\')</a></li>\r\n</ul>\r\n<hr />\r\n<form method=\"POST\">\r\n<input type=\"text\" name=\"name\" value=\"NAME TEST\" />\r\n<input type=\"submit\" />\r\n</form>','2013-03-06 10:44:57','zf2f-2013-02-25','doug@unlikelysoruce.org','zf2'),(8,'VM Files','Contains the source code developed in-class:\r\nhttp://zf2.unlikelysource.org/download/zf2f_vm_files.zip','2013-03-12 11:09:13','zf2f-2013-02-25','doug@unlikelysoruce.org','zf2'),(9,'Test 1 A','Test 1 A A','2013-03-18 17:53:29','test 1','doug@unlikelysource.com','test'),(11,'Test 2','Test 2','2013-05-02 22:09:56','test 1','','zf2');
